contracts/AppRouter.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./manager/FoodManager.sol";
import "./models/FoodStructs.sol";
import "./interfaces/IFoodManager.sol"; 
contract AppRouter {
    IFoodManager public foodManager; // Declare as interface

    constructor(address _foodManagerAddress) {
        foodManager = IFoodManager(_foodManagerAddress);  // Cast address to interface
    }

    function createFoodFromRouter(
        uint256 foodId,
        string memory name,
        string memory description,
        uint256 categoryId,
        string memory imageUrl,
        FoodDetail[] memory fd
    ) external {
        foodManager.createFood(foodId, name, description, categoryId, imageUrl, fd);
    }
}

contracts/interfaces/IFoodManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../models/FoodStructs.sol";

interface IFoodManager {
    event FoodCreated(
        uint256 foodId,
        string name,
        string description,
        uint256 categoryId,
        string imageUrl
    );

    function createFood(
        uint256 foodId,
        string memory name,
        string memory description,
        uint256 categoryId,
        string memory imageUrl,
        FoodDetail[] memory foodDetails
    ) external;

    function addFoodDetails(uint foodId, FoodDetail[] memory details) external;
    function getFoodDetails(uint foodId) external view returns (FoodDetail[] memory);
    function getFood(uint foodId) external view returns (Food memory);
    function getAllFoods() external view returns (FoodWithDetails[] memory);
}

contracts/models/FoodStructs.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

struct Food {
    uint foodId;
    string name;
    string description;
    uint categoryId;
    string imageUrl;
}

struct FoodDetail {
    uint foodDetailId;
    string size;       // VD: Small, Medium, Large
    uint quantity;     // tồn kho
    uint price;        // giá theo size
}
struct FoodWithDetails { // Struct mới để chứa cả Food và FoodDetail
    Food food;
    FoodDetail[] foodDetails;
}

contracts/manager/FoodManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../interfaces/IFoodManager.sol";
import "../models/FoodStructs.sol";
import "../utils/RoleManager.sol";

contract FoodManager is IFoodManager, RoleManager {
    uint public nextFoodId = 1;

    mapping(uint => Food) private foods;
    mapping(uint => FoodDetail[]) private foodDetails;
    uint[] private foodIds;

    function createFood(
        uint256 _foodId,
        string memory _name,
        string memory _description,
        uint256 _categoryId,
        string memory _imageUrl,
        FoodDetail[] memory _foodDetail
    ) external override onlyAdmin {
        // Kiểm tra xem ID thực phẩm đã tồn tại chưa
        require(foods[_foodId].foodId == 0, "Food with this ID already exists");

        // Gán ID và lưu trữ thông tin thực phẩm
        Food memory newFood = Food({
            foodId: _foodId,
            name: _name,
            description: _description,
            categoryId: _categoryId,
            imageUrl: _imageUrl
        });
        foods[_foodId] = newFood;
        foodIds.push(_foodId);

        // Lưu trữ chi tiết món ăn
        for (uint i = 0; i < _foodDetail.length; i++) {
            foodDetails[_foodId].push(_foodDetail[i]);
        }

        // Phát sinh sự kiện FoodCreated
        emit FoodCreated(
            _foodId,
            _name,
            _description,
            _categoryId,
            _imageUrl
        );
    }
//  admin thêm chi tiết món mới
    function addFoodDetails(uint foodId, FoodDetail[] memory details) external override onlyAdmin {
        //  Require that the food exists.
        require(foods[foodId].foodId != 0, "Food does not exist");
        for (uint i = 0; i < details.length; i++) {
            foodDetails[foodId].push(details[i]);
        }
    }

    function getFoodDetails(uint foodId) external view override returns (FoodDetail[] memory) {
         require(foods[foodId].foodId != 0, "Food does not exist");
        return foodDetails[foodId];
    }

    function getFood(uint foodId) external view override returns (Food memory) {
        return foods[foodId];
    }

    function getAllFoods() external view override returns (FoodWithDetails[] memory) {
        FoodWithDetails[] memory allFoods = new FoodWithDetails[](foodIds.length);
        for (uint i = 0; i < foodIds.length; i++) {
            uint foodId = foodIds[i];
            allFoods[i] = FoodWithDetails({
                food: foods[foodId],
                foodDetails: foodDetails[foodId]
            });
        }
        return allFoods;
    }
}

contracts/utils/RoleManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RoleManager {
    mapping(address => bool) public isAdmin;

    modifier onlyAdmin() {
        require(isAdmin[msg.sender], "You are not admin");
        _;
    }
    function addAdmin(address _admin) external {
        // implement quyền cấp cao hơn nếu cần
        isAdmin[_admin] = true;
    }

    function removeAdmin(address _admin) external {
        isAdmin[_admin] = false;
    }
}

